package com.letv.leauto.ecolink.ui.leradio_interface.data;import java.util.List;/** * Created by shimeng on 14/12/23. */public class VideoAlbums {    private String name;    private String albumId;    private String rating;    private List<String> starring;    private List<String> directory;    private String images;    private String type;    public void setAlbumId(String albumId) {        this.albumId = albumId;    }    public String getAlbumId() {        return albumId;    }    public void setRating(String rating) {        this.rating = rating;    }    public String getRating() {        return this.rating;    }    public void setStarring(List<String> starring) {        this.starring = starring;    }    public List<String> getStarring() {        return this.starring;    }    public void setDirectory(List<String> directory) {        this.directory = directory;    }    public List<String> getDirectory() {        return this.directory;    }    public String getImg() {        return images;    }    public void setImg(String img) {        this.images = img;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }}